INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, "そうね、逞しい人たちだものね……\nはあ、懐かしい。あの人たちには昔、\nよく研究のことで因縁をつけられたわ。", 1007404, 0, 5, 1007404055, 0.5, 0, 117531, 0, 11);
